import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpButton from "./Buttons/UpButton";
import { MainDiv, StyledPaper, ItalicText, Text } from "./styles/ContentPages";
import { StyledCard, StyledCharliePic, CharlieDiv} from "./styles/Charlie"

import styled from "styled-components";
import Paper from "@material-ui/core/Paper";

const GreenHyperlink = styled.a`
  color: #6e7c5e;
`;

const GreenPaper = styled(Paper)`
width: 80%;
margin-top: 3em;
  background-color: #eaede7;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-bottom: 1em;
`;



const TextDiv = styled.div`
display: flex;
flex-direction: column;
  justify-content: center;
  align-items: center;

`
export const ProjectTitle = styled.h1`
color: #000000;
font-weight: 400;
font-size: 4em;
text-align: center;

margin: 0em;
@media (max-width: 768px) {
  font-size: 3em;
}
`;

const ProjectImg = styled.img`
height: 32vh;
  width: 48vh;
  border-radius: 2%;

  @media (max-width: 768px) {
    height: 30vh;
    width: 40vh;
  }
`

export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <GreenPaper elevation={12}>
            <TextDiv>
              <ProjectTitle>SETTLE</ProjectTitle>
              <Text>talk about project here, links below</Text>
            </TextDiv>
           <ProjectImg alt="settle" src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583451000/Screen_Shot_2020-03-05_at_6.29.19_PM_tnhxeo.png"/>
          </GreenPaper>
          <ItalicText>
            The git repository for the site can be found{" "}
            <GreenHyperlink
              href="https://github.com/janeszelag/resumesite"
              target="_blank"
              rel="noopener noreferrer"
            >
              here.
            </GreenHyperlink>
          </ItalicText>
          <UpButton onClick={() => props.scrollUp()} />
        </StyledPaper>
      </Zoom>
    </MainDiv>
  );
}
